import Header from "./components/HeaderNav.index";
import Cards from "./components/Card.index";

export default function App() {
  return (
    <div id="app">
      <div className="container">
        <Header />
        <div className="row">
          <Cards />
          <Cards />
          <Cards />
          <Cards />
        </div>
      </div>
    </div>
  );
}
